import React from "react";


export default class CreateTodo extends React.Component{
    state = {
        user:'user',
        title:'title',
        description:'description',
        category:'category',
    }
    render(){
    return(
        <>
        <div className="registrationDiv">
            <p>Create Todo</p>
            <span>Sign in</span>
            <div className="forms">
                <input onChange={event => this.setState({user:event.target.value})}     value ={user}     type="text"      placeholder="text" />
                <input onChange={event => this.setState({title:event.target.value})}     value ={title}     type="text"      placeholder="text" />
                <input onChange={event => this.setState({description:event.target.value})}  value ={description}  type="text"  placeholder="text" />
                <input onChange={event => this.setState({category:event.target.value})}  value ={category}  type="text"  placeholder="text" />
            </div> 
            <p id="errortext">{error}</p>
            {/* <button type="submit" id="but" onClick={event => console.log( event.target.id)}>Create</button> */}
            <button  type="submit" id="but" >Sign in</button>
        </div>          
        </>
    )
}}
